import React, { useState, useEffect } from 'react';
import jsonData from './input/input.json';

const ContractRenderer = ({ data }) => {
    if (!data || !Array.isArray(data)) return null;

    const renderNode = (node, key, clauseCount = { clause: 1 }, parentKey = '') => {
        if (!node) return null; //missing node

        // Render text nodes
        if (typeof node.text === "string") {
            let style = {};
            if (node.bold) style.fontWeight = "bold";
            if (node.underline) style.textDecoration = "underline";
            if (node.color) style.backgroundColor = node.color;

            const textParts = node.text.split('\n');
            return textParts.map((part, index) => (
                <React.Fragment key={`${parentKey}-${index}`}>
                    <span style={style}>{part}</span>
                    {index < textParts.length - 1 && <br />} {/*handling /n*/}
                </React.Fragment>
            ));
        }

        if (!node.type || !node.children) return null;

        //Render nodes based on type
        switch (node.type) {
            case 'h1':
                return <h1 key={key}>{node.children.map((child, index) => renderNode(child, `${key}-${index}`, clauseCount, `${key}-${index}`))}</h1>;
            case 'h4':
                const clauseNumber = `${clauseCount.clause}: `;
                clauseCount.clause += 1; //Increment the clause count for the next <h4>

                return (
                    <h4 key={key}>
                        <span>{clauseNumber}</span>
                        {node.children.map((child, index) => renderNode(child, `${key}-${index}`, clauseCount, `${key}-${index}`))}
                    </h4>
                );
            case 'p':
                const Tag = 'p';
                return (
                    <Tag key={key}>
                        {node.children.map((child, index) => {
                            // Apply bold only if explicitly set
                            if (child.bold) {
                                return <strong key={index}>{renderNode(child, `${key}-${index}`, clauseCount, `${key}-${index}`)}</strong>;
                            }
                            if (child.type === 'mention') {
                                return <span key={index} style={{ backgroundColor: child.color }}>{renderNode(child, `${key}-${index}`, clauseCount, `${key}-${index}`)}</span>;
                            }
                            if (child.text === '\n') {
                                return <br key={index} />;
                            }
                            return renderNode(child, `${key}-${index}`, clauseCount, `${key}-${index}`);
                        })}
                    </Tag>
                );
            case 'ul':
                return <ul key={key}>{node.children.map((child, index) => renderNode(child, `${key}-${index}`, clauseCount, `${key}-${index}`))}</ul>;
            case 'li':
                return <li key={key}>{node.children.map((child, index) => renderNode(child, `${key}-${index}`, clauseCount, `${key}-${index}`))}</li>;
            case 'lic':
                return <React.Fragment key={key}>{node.children.map((child, index) => renderNode(child, `${key}-${index}`, clauseCount, `${key}-${index}`))}</React.Fragment>;
            case 'mention':
                return <span key={key} style={{ backgroundColor: node.color }}>{node.children.map((child, index) => renderNode(child, `${key}-${index}`, clauseCount, `${key}-${index}`))}</span>;
            case 'block':
            case 'clause':
                return <div key={key}>{node.children.map((child, index) => renderNode(child, `${key}-${index}`, clauseCount, `${key}-${index}`))}</div>;
            default:
                console.warn('Unknown node type:', node.type); // Log unknown node types
                return null;
        }
    };

    return <div>{data.map((node, index) => renderNode(node, `${index}`, { clause: 1 }))}</div>;
};

function App() {
    const [data, setData] = useState(null);

    useEffect(() => {
        console.log('JSON Data:', JSON.stringify(jsonData, null, 2)); // Log formatted JSON
        setData(jsonData);
    }, []);

    if (!data) {
        console.log('Data is not loaded yet.');
        return <div>Loading...</div>;
    }

    console.log('Rendering with data:', data);
    return (
        <div className="p-8">
            <ContractRenderer data={data} />
        </div>
    );
}

export default App;
